window.bookSummaryJSON = "<p>John Lee has left Earth behind him as he travels to the capital of the Galactic Council. Seeking rest and an answer to what the enigmatic System is, John plans to spend his time reading and researching on Irvina. But fate has other plans for the human Paladin. Faced with a new quest and a Galactic Society that is as unfair to its citizens as it was to Earth, John must decide if his desire for a quieter life outweighs his conscience.</p> <p><i>Stars Awoken</i> is book seven of the System Apocalypse, a LitRPG post-apocalyptic series that combines modern day life, science fiction and fantasy elements along with game mechanics.</p>"; 
